"use strict";function ConfirmDelete(n,t){ShowConfirmAlert("آیا مطمئن به حذف هستید؟","شما قادر نخواهد بود برای بازیابی این آیتم کاری انجام دهید...",function(i){i&&SendPostRequestWithAntiforgery("/"+n+"/Delete",{id:t},function(){$("#i"+t).fadeOut(600,function(){$(this).remove()});refreshGrid("#grid_"+n);OpenWindowCreate("/"+n+"/Create",null)})})}function ConfirmDeleteFullUrl(n,t,i){ShowConfirmAlert("آیا مطمئن به حذف هستید؟","شما قادر نخواهد بود برای بازیابی این آیتم کاری انجام دهید...",function(r){r&&SendPostRequestWithAntiforgery("/"+n+"/"+t,{id:i},function(){$("#i"+i).fadeOut(600,function(){$(this).remove()})})})}